style.css:
@-moz-document domain("youtube.com") {
/* scrubber button */
.html5-scrubber-button:hover, .ytp-scrubber-button:hover, .ytp-swatch-background-color, .ytp-swatch-background-color-secondary {
   background: #22BA69 !important;
}
/* progress bar */
.html5-play-progress, .ytp-play-progress {
   background: #22BA69 !important; 
}
.ytp-volume-slider-track, .ytp-volume-slider-handle:before {
   background: #22BA69 !important;
   z-index: -117;
}
.ytp-settings-button.ytp-hd-quality-badge::after, .ytp-settings-button.ytp-4k-quality-badge::after, .ytp-settings-button.ytp-5k-quality-badge::after, .ytp-settings-button.ytp-8k-quality-badge::after, .ytp-settings-button.ytp-3d-badge::after {
   background-color: #22BA69 !important;
}
.ytp-swatch-color {
   color: #22BA69 !important;
}
.ytp-menuitem[aria-checked="true"] .ytp-menuitem-toggle-checkbox {
   background: #22BA69 !important;
}
.ytp-chrome-controls .ytp-button.ytp-youtube-button:hover:not([aria-disabled="true"]):not([disabled]) .ytp-svg-fill-logo-tube-lozenge {
   fill: #22BA69 !important;
}
.ytp-cued-thumbnail-overlay:hover .ytp-large-play-button-bg, .ytp-large-play-button.ytp-touch-device .ytp-large-play-button-bg {
   fill: #22BA69 !important;
}
body {
  overflow-x: hidden;
}
body[data-spf-name='watch'] #yt-masthead-container {
  opacity: 0;
  transition: opacity .2s .3s;
}
body[data-spf-name='watch'] #yt-masthead-container:hover {
  opacity: 1;
}

.watch-stage-mode .html5-video-content, .watch-stage-mode video {
  width: 100%!important;
  height: 100vh!important;
}

.html5-video-content,
.ad-container,
video,
#content,
.player-width,
.player-height {
  transition: all .2s;
}
.watch-stage-mode .player-width {
  width: 100%;
}
.watch-stage-mode .player-height {
  height: 100vh;
}
.watch-stage-mode .html5-video-container video {
  top: 0!important;
  left: 0!important;   
}
.watch-stage-mode #player, .watch-stage-mode #placeholder-player {
  margin-top: -60px;
}
.watch-stage-mode .player-width, .ytp-chrome-bottom, #watch7-container {
  left: 0;
  right: 0;
  margin: 0 auto;
}
.watch-stage-mode #watch7-container {
  max-width: 1280px;
  display: flex;
  justify-content: center;
}
.watch-stage-mode .ytp-tooltip.ytp-preview {
  left: 0!important;
  right: 0!important;
  top: auto!important;
  bottom: 50px;
  margin: 0 auto;
  max-width: 96px!important;
}
.watch-stage-mode .ytp-tooltip.ytp-bottom {
  top: inherit!important;
  bottom: 50px;
}
#a11y-announcements-container {
  visibility: hidden;
}
.watch-stage-mode .ad-container {
  width: 100vw!important;
  height: 100vh!important;
}
.watch-stage-mode .video-ads {
  pointer-events: none;
}
.watch-stage-mode .close-padding {
  pointer-events: auto;
}

/* 360 video */
.watch-stage-mode .html5-video-container {
  height: 100vh;
  width: 100vw;
  display: flex;
  flex-flow: row wrap;
  justify-content: center;
}
.watch-stage-mode .webgl {
  top: 50%!important;
  transform: translateY(-50%);
  display: flex;
  width: 100vw;
  height: 100%;
  justify-content: center;
}
.watch-stage-mode .webgl canvas {
  height: inherit;
}
.watch-stage-mode .ytp-webgl-spherical-control {
  top: 60px!important;  
}

/* Playlist */
.watch-stage-mode #player-playlist .watch-playlist {
  top: 10px;
}
.watch-wide #player-playlist .watch-playlist {
  -moz-transform: translateY(100vh);
  -ms-transform: translateY(100vh);
  -webkit-transform: translateY(100vh);
  transform: translateY(100vh);
}

/* Frame preview */
.watch-stage-mode .ytp-storyboard {
  transform: translateX(16.5%);
}
.watch-stage-mode .ytp-storyboard-framepreview {
  display: none!important;
}

/* Annotations */
.watch-stage-mode .ytp-iv-video-content {
  left: 50%!important;
  top: 50%!important;
  transform: translateX(-50%) translateY(-50%);
  z-index: 10;
  pointer-events: none;
}
.watch-stage-mode .ytp-iv-video-content * {
  pointer-events: auto;
}
.options-renderer-submit-button {
  	border-color: #167ac6 !important;
    background: #167ac6 !important;
    border: solid 1px transparent !important;
    border-radius: 2px !important;
    box-shadow: 0 1px 0 rgba(0,0,0,0.05) !important;
}
